--
-- Procedure
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `sale_chat_clean` ()   BEGIN
    DELETE FROM chat WHERE postType='sale' AND datetime<DATE_ADD(NOW(), INTERVAL -7 DAY);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `team_chat_clean` ()   BEGIN
    CREATE TABLE temp AS (SELECT chat.id AS id
    FROM chat 
    WHERE chat.postType='team' 
    AND (SELECT COUNT(*) FROM chatuser WHERE chatuser.chatId=chat.id)<=1 
    AND NOW() >= DATE_ADD((SELECT datetime FROM postteam WHERE postteam.id=chat.postId), INTERVAL 3 DAY));
    DELETE FROM chat WHERE id IN (SELECT id FROM temp);
    DROP TABLE temp;
END$$

DELIMITER ;

